import { View, Text } from 'react-native'
import React from 'react'
import { TouchableOpacity } from 'react-native-web';
import ComminityMaterialIcons from 'react-native-vector-icons/Ionicons'

export default function RestaurantItem() {
  return (
    <View>
      {/* Restaurant Image */}
      {/*  Restaurant Info */}
    </View>
  )
}


const RestaurantImage = () => (
  <>
      <Image
      source = {{
            uri : "https://images.pexels.com/photos/67468/pexels-photo-67468.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1",
      }}
      style ={{ width : "100%" , height : 180}}
      />
      <TouchableOpacity>
      <MaterialCommunityIcons name="heart-outline" size={25} color="#fff"></MaterialCommunityIcons>
      </TouchableOpacity>
      </>
);
